import React, { Component } from "react";
import { HamburgerArrow } from "react-animated-burgers";

class Popup extends Component {
  constructor(props) {
    super(props);
  }
  render() {
    return (
      <div className="menu">
        <HamburgerArrow
          isActive={this.state.isActive}
          toggleButton={this.toggleButton}
        />
      </div>
    );
  }
}

export default Popup;
